            <div align ="center">
                <h1>Bike Distribution</h1>
            </div>
            
                <Grid>
                    <Cell col={6}>
                        <h3>Projects</h3>
                        

                    </Cell>
                    <Cell col={6}>
                        <h3>Districts </h3>
                         

                        

                    </Cell>
                    <Cell col={12}>
                    <h2 aling = "center"> Add Bike Distribution Information</h2>
                    
                    
                    </Cell>
                </Grid>
                </div>
            
        )
    }
}

export default BikeDistribution;
